?><p style="font-family: Arial, Verdana, sans-serif; font-size: 12px; text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;"><span style="line-height: 18px;">История этой знаменитой часовой марки начинается с 1846-го года. Создатель бренда Улисс Нардан является представителем известной династии часовщиков. Перед созданием собственной компании, он несколько лет обучался у своего отца и двух часовщиков, которых звали Фредерик Дюбуа и Луи Брессель. Благодаря последнему, Улисс Нардан особенно заинтересовался морскими приборами, а в большинстве – хронометрами. Изначально, компания выпускала именно морские хронометры, которые были одновременно и дешевыми, и очень качественными, что сделало их очень популярными среди многих мореплавателей. Стоит отметить, что на сегодняшний день в послужном списке компании, есть около 4,5 тысяч специальных сертификатов, которые подтверждают точность и надежность их продукции. Но, в 1983 году, семейная компания была выкуплена Рольфом Шнайдером (компания не смогла пережить часовой кризис). После этого, интерес к компании, как со стороны инвесторов, так и со стороны часовой общественности, возрос. На сегодняшний день, компания&nbsp;</span><span lang="EN-US" style="line-height: 18px;">Ulysse</span><span lang="EN-US" style="line-height: 18px;">&nbsp;</span><span lang="EN-US" style="line-height: 18px;">Nardin</span><span lang="EN-US" style="line-height: 18px;">&nbsp;</span><span style="line-height: 18px;">является одной из самых популярных. Ее ассортимент насчитывает несколько десятков коллекций, среди которых встречаются и роскошные, и лимитированные. Есть и золотые, и серебряные, и платиновые часы, которые отличаются многофункциональностью, высоким качеством и надежностью.</span></span></span></p>
 
